import React, {Component} from 'react'
import Wishlist from './Wishlist.js'
  export default class AmiiboHomepage extends Component {
    constructor(props){
      super(props)
      this.state = {
        character: null
      }
    }

    addToList (event) {
      console.log(event)
      // const foundCharacter = this.props.mainList.findIndex()
    }
    render(){
      return(
        <>

        <Wishlist mainList={this.props.mainList} wishList={this.props.wishList} />

        <ul>

        { this.props.mainList.map((amiibo, i) => {
          return (
          <li key={i} onClick={(amiibo) => this.addToList()}>

            <img  src={amiibo.image} />
            <p>{amiibo.name}</p>
          </li>
        )
        })}

        </ul>

        </>
      )
    }
  }
